import React from "react";
import { Link } from "react-router-dom";

function Navigation() {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/admin/login">Login</Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navigation;
